INSERT INTO `film` (`id_film`, `nama_film`, `sutradara`, `aktor`, `sinopsis`, `poster_film`, `produksi`, `age`, `is_active`) VALUES
(1, 'Agak Laen', 'Muhadkly Acho', 'Bene Dion', 'Bene, Boris, Jegel, dan Oki merupakan empat sekawan yang telah berteman sejak lama. Namun, kondisi ekonomi mereka masih terpuruk meski sudah lama merantau. Keempat sahabat itu akhirnya melihat peluang baru saat pasar malam baru didirikan di dekat kediaman mereka. Bene, Boris, Jegel, dan Oki memutuskan membuat wahana rumah hantu di pasar malam tersebut. Mereka tidak hanya mengelola rumah hantu itu, tetapi juga menyiapkan konsep hingga menjadi hantu untuk menakut-nakuti pengunjung.', , 'Dipa Andika', '13+', 1);
INSERT INTO `film` (`id_film`, `nama_film`, `sutradara`, `aktor`, `sinopsis`, `poster_film`, `produksi`, `age`, `is_active`) VALUES
(2, 'Ancika', 'Benni Setiawan', 'Zee JKT48', 'Dikisahkan tentang persahabatan dan jalin hubungan antara Dilan dan Ancika Mehrunisa Rabu. Hubungan mereka yang semakin erat membuat benih-benih cinta tumbuh dan hubungan mereka pun menanjak hingga ke jenjang kekasih. Di tahun 1995, Dilan si mantan panglima geng motor jatuh cinta pada Ancika, perempuan yang sangat membenci geng motor.', , 'Budi Ismanto', '17+', 1);
INSERT INTO `film` (`id_film`, `nama_film`, `sutradara`, `aktor`, `sinopsis`, `poster_film`, `produksi`, `age`, `is_active`) VALUES
(3, 'Sekawan Limo', 'Bayu Skak', 'Bayu Skak', 'Bagas (Bayu Skak), Lenni (Nadya Arina), Dicky (Firza Valaza), Juna (Benidictus Siregar), dan Andrew (Indra Pramujito) dipersatukan ketika mendaki Gunung Madyopuro. Penjaga pos pendakian mewanti-wanti: rombongan harus genap dan dilarang menoleh ke belakang atau akan ada yang mengikuti. Mereka gagal mematuhi mitos, dan sepanjang perjalanan terus dihantui.', , 'Chand Parwez Servia', '13+', 1);
INSERT INTO `film` (`id_film`, `nama_film`, `sutradara`, `aktor`, `sinopsis`, `poster_film`, `produksi`, `age`, `is_active`) VALUES
(4, 'Perang Kota', 'Mouly Surya', 'Chicco Jerikho', 'Film ini mengambil latar belakang di Jakarta pada tahun 1946 yang mengisahkan tentang Isa, seorang mantan petarung dan pemain biola berusia 35 tahun yang kini menjadi guru sekolah dasar. Pengabdiannya selama perang kemerdekaan membuatnya mempunyai reputasi sebagai prajurit kawakan.', , 'Rama Adi', '13+', 1);
INSERT INTO `film` (`id_film`, `nama_film`, `sutradara`, `aktor`, `sinopsis`, `poster_film`, `produksi`, `age`, `is_active`) VALUES
(5, 'Qodrat 2', 'Charles Gozali', 'Vino G Bastian', 'Setelah pertempuran sengit melawan Assu’ala di film pertama, Ustadz Qodrat (Vino G. Bastian) melanjutkan perjalanannya mencari istrinya, Azizah (Acha Septriasa), yang mengalami depresi setelah menyerahkan dirinya pada kekuatan jahat demi menyelamatkan putra mereka, Alif. Azizah yang sempat dirawat di rumah sakit jiwa akhirnya keluar dan bekerja di sebuah pabrik pemintalan. Namun, pabrik tersebut menyimpan rahasia kelam.', , 'Linda Gozali', '13+', 1);
